import React from "react";
import { Link } from "react-router-dom";
import "./Style.css";
import authIcon from ".../images/auth.png"; // Remplace par ton chemin d'icône

const Navbar = ({ hideAuthIcon }) => {
  return (
    <nav className="navbar">
      <div className="navbar-container">
        <div className="brand">
          <Link to="/">CHRONOLITHE.</Link>
        </div>
        <ul>
          <li>
            <Link to="/shop">Shop</Link>
          </li>
          <li>
            <Link to="/about">À Propos</Link>
          </li>
          <li>
            <Link to="/contact">Contact</Link>
          </li>
        </ul>
        {!hideAuthIcon && (
          <div className="auth-block">
            <img src={authIcon} alt="Connexion" className="auth-icon-image" />
            <span className="auth-text">Connexion/Inscription</span>
          </div>
        )}
      </div>
    </nav>
  );
};

export default Navbar;
